import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import RootLayout from "./screens/RootLayout";
import MainPage from "./screens/MainPage";
import SignInPage from "./screens/SignInPage";
import NowPlayingPage from "./screens/RenderMoviePages/NowPlayingPage";
import PopularPage from "./screens/RenderMoviePages/PopularPage";
import TopRatedPage from "./screens/RenderMoviePages/TopRatedPage";
import UpComingPage from "./screens/RenderMoviePages/UpComing";
import NotFound from "./screens/NotFound";
import MovieDetailPage from "./screens/MovieDetailPage";

function App() {
  return (
    <Router>
      <Routes>
        <Route
          path="/"
          element={
            <RootLayout>
              <MainPage />
            </RootLayout>
          }
        />
        <Route
          path="/signIn"
          element={
            <RootLayout>
              <SignInPage />
            </RootLayout>
          }
        />
        <Route
          path="/nowPlaying"
          element={
            <RootLayout>
              <NowPlayingPage />
            </RootLayout>
          }
        />
        <Route
          path="/popular"
          element={
            <RootLayout>
              <PopularPage />
            </RootLayout>
          }
        />
        <Route
          path="/topRated"
          element={
            <RootLayout>
              <TopRatedPage />
            </RootLayout>
          }
        />
        <Route path="/movie/:id" component={<MovieDetailPage />} />
        <Route
          path="/upComing"
          element={
            <RootLayout>
              <UpComingPage />
            </RootLayout>
          }
        />
        <Route path="*" element={<NotFound />} />
      </Routes>
    </Router>
  );
}

export default App;
